import React from 'react';
import '../styles/Convertation.css'; // Import CSS khusus komponen ini

const ChatMessage = ()=>{
    return (
        <div className="chat-conversation">
            <div className="message sender">
                <div className="message-content">
                    Hi! Apakah kamu sudah cek laporan yang saya kirim?,      Hi! Apakah kamu sudah cek laporan yang saya kirim?
                    <div className="message-meta">
                        <span className="time">03.08</span>
                        <span className="check">✔✔</span>
                    </div>
                </div>
            </div>

            <div className="message receiver">
                <div className="message-content">
                Ya, saya sudah cek dan akan saya kirim feedback-nya hari ini.
                <div className="message-meta">
                    <span className="time">03.09</span>
                </div>
                </div>
            </div>
        </div>

    );
};

export default ChatMessage;
